	function init() {

		container = document.createElement('div');
		document.body.appendChild(container);

		var info = document.createElement('div');
		info.style.position = 'absolute';
		info.style.top = '10px';
		info.style.width = '100%';
		info.style.textAlign = 'center';
		info.innerHTML = 'Simple procedurally-generated shapes<br/>Drag to spin';
		container.appendChild(info);

		scene = new THREE.Scene();
		scene.background = new THREE.Color(0xf0f0f0);

		camera = new THREE.PerspectiveCamera(50, window.innerWidth / window.innerHeight, 1, 1000);
		camera.position.set(0, 150, 500);
		scene.add(camera);

		var light = new THREE.PointLight(0xffffff, 0.8);
		camera.add(light);
		controls = new THREE.MapControls(camera, container);
		controls.screenSpacePanning = false;
		controls.maxDistance = 9000;
		controls.minDistance = 1;

		group = new THREE.Group();
		group.position.y = 50;
		scene.add(group);

		function addAxis() {
			var geometry;
			geometry = new THREE.Geometry();
			geometry.vertices.push(new THREE.Vector3(0, 0, 0));
			geometry.vertices.push(new THREE.Vector3(0, 100, 0));
			var axisY = new THREE.Line(geometry, new THREE.LineBasicMaterial({color: 0x00ff00}));

			geometry = new THREE.Geometry();
			geometry.vertices.push(new THREE.Vector3(0, 0, 0));
			geometry.vertices.push(new THREE.Vector3(100, 0, 0));
			var axisX = new THREE.Line(geometry, new THREE.LineBasicMaterial({color: 0xff0000}));

			geometry = new THREE.Geometry();
			geometry.vertices.push(new THREE.Vector3(0, 0, 0));
			geometry.vertices.push(new THREE.Vector3(0, 0, 100));
			var axisZ = new THREE.Line(geometry, new THREE.LineBasicMaterial({color: 0x0000ff}));

			group.add(axisY);
			group.add(axisX);
			group.add(axisZ);

		}


		function addShape(id, shape, extrudeSettings, color, x, y, z, axis, angel) {
			var geometry = new THREE.ExtrudeBufferGeometry(shape, extrudeSettings);
			var mesh = new THREE.Mesh(geometry, new THREE.MeshPhongMaterial({color: color}));
			mesh.name = id;
			if (axis.length() === 1) mesh = mesh.rotateOnAxis(axis, -Math.PI / 180 * angel);
			mesh.position.set(x, z, -y);
			group.add(mesh);
		}

		function getShape(arr, inner = true) {
			var vertices = [];
			var type = arr[0];
			if (type === 1) {
				var shape = new THREE.Shape();
				shape.moveTo(arr[1], arr[2]);
				for (var i = 3; i < arr.length; i += 2) {
					shape.lineTo(arr[i], arr[i + 1]);
				}
				shape.closePath();
				return shape;
			} else if (type === 2) {
				var [_, radius, x, y] = arr;

				var circle = new THREE.EllipseCurve(x, y, radius, radius, 0, 2 * Math.PI, inner, 0);
				return new THREE.Shape(circle.getPoints(32));
			} else {
				var shape = new THREE.Shape();
				shape.moveTo(arr[1][1], arr[1][2]);
				for (var i=1;i<arr.length;i++){
					var [t,x,y,cx,cy,r,s,e] = arr[i];
					if (t === 2){
						shape.absarc(x,y,r,s,e);
					}else{

					}
				}
			}

		}

		function extractPoint(center, radius, startAngle, endAngle){
			var circle = new THREE.EllipseCurve(center.x, center.y, radius, radius, startAngle, endAngle, false, 0);
			//完整圆画32面体
			var delta = endAngle - startAngle;
			var interval = Math.round(delta * 16 / Math.PI);
			return circle.getPoints(interval);
		}

		function drawData(item) {
			var [id, index] = item[0];
//			if (id != 3379709) return;
			var c = colors[index];
			var color = new THREE.Color(c[0] / 255, c[1] / 255, c[2] / 255);

			for (var i = 1; i < item.length; i += 3) {
				var [offsetX, offsetY, offsetZ, depth, rotate, axisX, axisY, axisZ] = item[i];
				var axis = new THREE.Vector3(axisX, axisZ, axisY);
				var vertices = item[i + 1];
				var holes = item[i + 2];

				var shape = getShape(vertices, false);
				shape.holes.push(...holes.map(hole => getShape(hole)
			))
				;

				var extrudeSettings = {
					depth: depth,
					bevelEnabled: false,
				};
				addShape(id, shape, extrudeSettings, color, offsetX, offsetY, offsetZ, axis, -rotate);
			}

	function onWindowResize() {

		camera.aspect = window.innerWidth / window.innerHeight;
		camera.updateProjectionMatrix();

		renderer.setSize(window.innerWidth, window.innerHeight);

	}

	//
	function onDocumentMouseDown(event) {

		//通过鼠标点击的位置计算出raycaster所需要的点的位置，以屏幕中心为原点，值的范围为-1到1.
		mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
		mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

		// 通过鼠标点的位置和当前相机的矩阵计算出raycaster
		raycaster.setFromCamera(mouse, camera);

		// 获取raycaster直线和所有模型相交的数组集合
		var intersects = raycaster.intersectObjects(group.children);
		if (intersects.length > 0) {
			intersectBefuuid = intersects[0].object.uuid;
		}
		else {
			intersectBefuuid = "";
		}
	}


	function onDocumentMouseUp(event) {

		//通过鼠标点击的位置计算出raycaster所需要的点的位置，以屏幕中心为原点，值的范围为-1到1.
		mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
		mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

		// 通过鼠标点的位置和当前相机的矩阵计算出raycaster
		raycaster.setFromCamera(mouse, camera);

		// 获取raycaster直线和所有模型相交的数组集合
		var intersects = raycaster.intersectObjects(group.children);

		if (intersects.length == 0 && intersectNow == null) {
			return;
		}

		if (intersects.length == 0 && intersectNow != null) {
			intersectNow.object.material.color.set(intersectColor);
			intersectNow.object.material.opacity = 1;
			intersectNow = null;
			intersectColor = null;
			return;
		}
		if (intersects.length > 0 && intersectNow != null) {
			intersectNow.object.material.color.set(intersectColor);
			intersectNow.object.material.opacity = 1;
			intersectNow = intersects[0];
			intersectColor = intersectNow.object.material.color.clone();
			intersectNow.object.material.color.set(0x0000ff);
			intersectNow.object.material.opacity = 0.6;
			console.log(intersects[0]);
			console.log(intersects[0].object.name);
			return;
		}
		if (intersects.length > 0 && intersectNow == null) {
			intersectNow = intersects[0];
			intersectColor = intersectNow.object.material.color.clone();
			intersectNow.object.material.color.set(0x0000ff);
			intersectNow.object.material.opacity = 0.6;
			console.log(intersects[0]);
			console.log(intersects[0].object.name);
			return;
		}
	}

	function animate() {
		requestAnimationFrame(animate);

		controls.update();
		render();
		stats.update();

	}

		renderer.render(scene, camera);
